script: |
  super -f text -I q207.spq | sort > q207.out

inputs:
  - name: q207.spq
    data: |
      SELECT ALL 20 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - 70 * + col2 BETWEEN - 61 AND ( col0 * col0 + col1 );
  - name: tab0

outputs:
  - name: q207.out
    data: |
      20
      20
      20
